actionConfiguration.body:
country => {
  let avg = Data.GetCurrentUser().Averages;
  let user_averages = {};
  Data.GetCategories().forEach(c => {
    let sum = 0, n = 0;
    avg.forEach(a => {
      if (a[c]) sum += a[c];
      n++;
    });
    user_averages[c] = Math.ceil(sum / n);
  });
  return Data.GetTopSpendingCategories("Portugal").map(x => {
    return {
      x: x[1],
      y: user_averages[x[1]]
    };
  });
}

